camera = new THREE.PerspectiveCamera( 45, window.innerWidth / window.innerHeight,0.32018155964371925,0.7354537491134648);
camera.position.set(0.3035672340100314,0.3035672340100314,0.3035672340100314);
camera.lookAt( new THREE.Vector3(0,0,0) );
group = new THREE.Group();
var loadingManager = new THREE.LoadingManager( function() {
scene.add( group );
group.add( ggbExport );
ggbExport.translateX(0.07260279997207986);
ggbExport.translateY(-0.0108658554212656);
ggbExport.translateZ(-0.0032589345057380294);

var loader = new THREE.ColladaLoader( loadingManager );

} );
var ambientLight = new THREE.AmbientLight( 0xcccccc, 0.4 );
scene.add( ambientLight );

directionalLight.position.set( 1, 1, 0 ).normalize();
scene.add( directionalLight );
renderer = new THREE.WebGLRenderer();
renderer.setClearColor( 0xffffff, 1);

renderer.setSize( window.innerWidth, window.innerHeight );
container.appendChild( renderer.domElement );

function animate() {

function render() {
var delta = clock.getDelta();
group.rotation.y += delta * 0.5;
renderer.render( scene, camera );
}
function removeChildrenFromNode(node) {
var fc = node.firstChild;
while( fc ) {
node.removeChild( fc );
fc = node.firstChild;
}
}
function svgSnapshot() {
var svgContainer = document.getElementById('svg');
removeChildrenFromNode(svgContainer);
var width = window.innerWidth;
var height = window.innerHeight;
svgRenderer = new THREE.SVGRenderer();
svgRenderer.setClearColor( 0xffffff );
svgRenderer.setSize(width,height );
svgRenderer.setQuality( 'high' );
svgContainer.appendChild( svgRenderer.domElement );
svgRenderer.render( scene, camera );
var svg = svgContainer.innerHTML;
svg = svg.replace('<svg ', '<svg id="svg2" xmlns="http://www.w3.org/2000/svg" ');
var svgDataURI = 'data:image/svg+xml;base64,' + btoa(unescape(encodeURIComponent(svg)));
document.getElementById('svg2').src = svgDataURI;
}
function create(text, name, type) {
var dlbtn = document.getElementById('dlbtn');
var file = new Blob([text], {type: type});
dlbtn.href = URL.createObjectURL(file);
 dlbtn.download = name;
}
function exportSTL() {
var export_stl = new THREE.STLExporter();
var output = export_stl.parse(scene);
create(output, 'output.stl', 'text/plain');
}
